I cannot forget, as well, parts of me fell all the way over there. You know the part, donâ€™t you? It isnâ€™t beautiful and lush and no sorts of cleanliness and it is all very well, because this is by far the most important and most wild place to fall; right on the edges. Edges of most everything. The edges of words that were never spoke because the tongue went numb and our mind lied in the most seducing way. The edges where the heart just is, not even a wound to claim it, the worst kind of heart, I think anyway, as a wound can very much be the lesson of the heart, to get it going, to get some sort of life in it. The edge where we skip-hop on by because the air is too thick. The air is always thick on the edge parts. It is lavish, not in the way we wear pearls, but in the way in which we climb and breath and climb and breath. And yes, that is holy.";}i:121;a:1:{s:14:"comments_count";i:5;}i:122;a:1:{s:11:"likes_count";i:7;}i:123;a:1:{s:4:"link";s:39:"https://www.instagram.com/p/CEvO0KpF5Yg";}i:124;a:1:{s:5:"image";s:249:"https://scontent-sin6-1.cdninstagram.com/v/t51.2885-15/e35/p1080x1080/118714271_610129686538524_7695699085123281897_n.jpg?_nc_ht=scontent-sin6-1.cdninstagram.com&_nc_cat=100&_nc_ohc=YcsRp1LAWJgAX_RvNam&oh=fa617bc92829840a1402f90ad14012fb&oe=5F7C1A73";}i:125;a:1:{s:4:"type";s:5:"image";}i:126;a:1:{s:8:"owner_id";i:1974886478;}i:127;a:1:{s:14:"owner_username";s:0:"";}i:128;a:1:{s:14:"owner_fullname";s:0:"";}i:129;a:1:{s:9:"owner_pic";s:0:"";}i:130;a:1:{s:2:"id";s:19:"2391193589058550793";}i:131;a:1:{s:10:"short_code";s:11:"CEvOeZxBrwJ";}i:132;a:1:{s:12:"created_time";i:1599272510;}i:133;a:1:{s:7:"caption";s:59:"Sleeping like a big girl thanks to auntie @brittanyk31 ğŸ˜˜";}i:134;a:1:{s:14:"comments_count";i:1;}i:135;a:1:{s:11:"likes_count";i:5;}i:136;a:1:{s:4:"link";s:39:"https://www.instagram.com/p/CEvOeZxBrwJ";}i:137;a:1:{s:5:"image";s:249:"https://scontent-sin6-2.cdninstagram.com/v/t51.2885-15/e35/s1080x1080/118734105_108956947532122_7318033774462630